import React from "react";
import Modal from "./Modal";
import ModifyButton from "./ModifyButton";

const Header = ({ userList, setUserList, isShown, setIsShon, handleShow }) => {



  return (
    <div className="header">
      <h1>User List</h1>
      <ModifyButton isShown={isShown} setIsShown={setIsShown} handleShow={handleShow}/>
      {isShown && <Modal />}
    </div>
  );
};

export default Header;
